.nuclide-ui-toolbar {
  display: flex;
  justify-content: space-between;
  flex-shrink: 0;
  height: 2.625em;
  line-height: 2.625em;
  padding: 0 12.5px;
}
.nuclide-ui-toolbar--bottom {
  border-top: 1px solid #1c1c1c;
}
.nuclide-ui-toolbar--top {
  border-bottom: 1px solid #1c1c1c;
}
.nuclide-ui-toolbar__center,
.nuclide-ui-toolbar__left,
.nuclide-ui-toolbar__right {
  align-items: center;
  display: flex;
  overflow: hidden;
  white-space: nowrap;
}
.nuclide-ui-toolbar__center:only-child,
.nuclide-ui-toolbar__left:only-child,
.nuclide-ui-toolbar__right:only-child,
.nuclide-ui-toolbar__center:nth-child(3),
.nuclide-ui-toolbar__left:nth-child(3),
.nuclide-ui-toolbar__right:nth-child(3),
.nuclide-ui-toolbar__center:nth-last-child(3),
.nuclide-ui-toolbar__left:nth-last-child(3),
.nuclide-ui-toolbar__right:nth-last-child(3) {
  flex: 1;
}
.nuclide-ui-toolbar__center {
  justify-content: center;
}
.nuclide-ui-toolbar__right {
  justify-content: flex-end;
}
